int lengthOfLongestSubstring(string& s) {
    if (s.length() <= 1)
        return s.length();
    int prev = 0;
    bool letter[256];
    int max = 0;
    for (int i = 0; i < s.length(); i++) {
        if (!letter[s[i]])
            letter[s[i]] = true;
        else {
            while (s[prev] != s[i] ) {
                letter[s[prev] ] = false;
                prev++;
            }
            prev++;
        }
        max = (max > (i - prev + 1))? max : (i - prev + 1);
    }
    return max;
}

